import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import Modal from 'react-modal';

const App = () => {
  const [modalIsOpen, setModalIsOpen] = useState(false)
  return (
    <div className="App">
      <button onClick={() => setModalIsOpen(true)}>რეგისტრაცია</button>
      <Modal isOpen={modalIsOpen}

  style={{
    overlay: {
      top: 0,
      left: 0,
      right: 0,
      bottom: 0,
      backgroundColor: 'rgba(0, 0, 0, 0.48)'
    },
    content: {
      top: '168px',
      left: '73px',
      width:'510px',
      height:'300px',
      right: '935px',
      bottom: '292px',
      border: '1px solid #ccc',
      background: '#fff',
      overflow: 'auto',
      WebkitOverflowScrolling: 'touch',
      borderRadius: '10px',
      outline: 'none',
      padding: '20px'
    }
  }}
      >
        <h2>Title</h2>
        <p>content</p>
        <div>
          <button onClick={() => setModalIsOpen(false)}>დახურვა</button>
        </div>


      </Modal>
    </div>
  )
}

const App2 = () => {
  const buttonStyle = {backgroundColor:'red'}

  const [modalIsOpen, setModalIsOpen] = useState(false)
  return (
    <div className="App">
      <button style={{backgroundColor:'transparent',border:'none',padding:'0'}} onClick={() => setModalIsOpen(true)}>
      ისტორია</button>
      <Modal isOpen={modalIsOpen}

  style={{
    overlay: {
      top: 0,
      left: 0,
      right: 0,
      bottom: 0,
      backgroundColor: 'rgba(0, 0, 0, 0.48)'
    },
    content: {
      top: '40px',
      left: '250px',
      right: '250px',
      margin:'auto',
      bottom: '40px',
      width:'1000px',
      height:'600px',
      border: '1px solid #35364A',
      background: '#fff',
      overflow: 'auto',
      WebkitOverflowScrolling: 'touch',
      borderRadius: '10px',
      outline: 'none',
      padding: '20px',
      backgroundColor: '#35364A',
    }
  }}
      >

        <div>
          <button onClick={() => setModalIsOpen(false)}><img alt="user" src="images/close.svg" /></button>
        </div>


      </Modal>
    </div>
  )
}

export { App , App2}
